          "BidInstruction": "<p style=\"margin-top:16px;text-indent:39px;line-height:150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">九一融易资产管理有限公司受委托，将于<span style=\"text-decoration:underline;\"><span style=\"color:red\">2020</span></span><span style=\"color:red\">年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">24</span>日10：00至<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">25</span>日10：00止</span>。在</span><span style=\"font-size:19px;line-height:150%;font-family:宋体\">京东网资产竞价网络平台（网址http://zichan.jd.com）</span><span style=\"font-size:19px;line-height:150%;font-family:宋体\">，对重庆市北部新区经开园金渝大道81号10栋1-10-3进行公开拍卖, 现就有关的网上拍卖事宜敬告各位竞买人：</span></p><p style=\";margin-bottom:0;text-indent:31px\"><span style=\"font-size:19px;font-family:宋体\">一、拍卖标的：重庆市北部新区经开园金渝大道81号10栋1-10-3</span></p><p style=\";margin-bottom:0;text-indent:59px\"><span style=\"font-size:19px;font-family:宋体\">小区名称：金山名都，权利性质：出让 ，装修，无租赁、空置，建筑面积为107.39㎡，套内面积：91.57㎡，户型：3室2厅1卫 ，名义层：10层，物理楼层：10层，房屋结构为：钢筋混凝土结构，房屋用途为：城镇住宅用地/普通住宅</span></p><p style=\";margin-bottom:0;text-indent:59px\"><span style=\"font-size:19px;font-family:宋体\">该房屋有银行抵押，成交后由<span style=\"text-decoration:underline;\">卖方负责</span>解押。</span></p><p style=\"margin-top:0;margin-bottom:0;margin-left: 0;margin-bottom:0;text-indent:31px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体;color:red\">买受人可选择全款支付或银行按揭贷款方式付款，拟以银行按揭贷款方式付款的竞买人，在竞买前务必与标的物联系人联系，了解付款和贷款的相关细节要求。</span></p><p style=\"margin-top:16px;text-indent:37px;line-height:150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">二、起拍价人民币140万元（壹佰肆拾万元整），保证金人民币7万元（柒万元整），加价幅度:5000元(及其整倍数)。</span></p><p style=\"text-indent: 37px;line-height: 150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">三、竞价时间：<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">24</span>日10时至<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">25</span>日10时止（届时正式竞价开始时间以京东网网络电子竞价系统时间为准）。</span></p><p style=\"margin-top:16px;text-indent:37px;line-height:150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">四、</span><span style=\"font-size:19px;line-height: 150%;font-family:宋体\">咨询、展示看样的时间与方式：自<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">13</span>日起至<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">25</span>日止接受咨询。联系人：冉经理15523666456，有意者请联系。</span></p><p style=\"margin-top:16px;text-indent:37px;line-height:150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">五、保证金交纳及处置</span></p><p style=\"text-indent:37px;line-height:38px\"><span style=\"font-size:19px;font-family:宋体\">竞买人</span><span style=\"font-size:19px;font-family:宋体\">竞拍前，竞买人须在京东注册账号并通过实名认证（已注册京东账号需通过实名认证）。竞买人在对标的物第一次确认出价竞拍前，按网络资产竞价平台服务系统提示在线报名缴纳保证金（因保证金金额较大，请提前开通网银支付的大额支付功能，或前往银行柜台办理提高网银支付限额的相关业务），支付后系统会自动冻结该笔保证金。具体要求请阅读竞价页面内的《竞买须知》、《保证金须知》及京东网络竞价平台告知的竞价流程（竞价前必看）的相关准则。竞价成交的，本标的物竞得者（以下称买受人）冻结的保证金将自动转为部分</span><span style=\"font-size:19px;font-family:宋体\">成交款</span><span style=\"font-size:19px;font-family:宋体\">。竞价结束后未能竞得者的保证金以及竞价未成交的（即流拍的）竞买人的保证金在竞价活动结束后即时解冻，保证金冻结期间不计利息。</span></p><p style=\"margin-top:16px;text-indent:37px;line-height:150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">六、成交价款的结算时间和方式</span></p><p style=\"margin-top:16px;text-indent:37px;line-height:150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">1</span><span style=\"font-size:19px;line-height:150%;font-family:宋体\">、全款支付的竞价余款买受人应在<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">30</span>日16:00时前将余款支付至九一融易资产管理有限公司指定账户。并在<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">30</span>日前（遇节假日顺延）（携带付款凭证及相关身份材料）到九一融易资产管理有限公司签署《拍卖成交确认书》《房屋买卖居间合同》，办理拍卖标的物交付相关手续。</span></p><p style=\"margin-top:16px;text-indent:37px;line-height:150%\"><span style=\"font-size:19px;line-height:150%;font-family:宋体\">2</span><span style=\"font-size:19px;line-height:150%;font-family:宋体\">、<a name=\"_Hlk41037424\"></a>贷款支付的竞价余款买受人应在<span style=\"text-decoration:underline;\">2020</span>年<span style=\"text-decoration:underline;\">7</span>月<span style=\"text-decoration:underline;\">30</span>日16:00时前将余款的首付款支付至九一融易资产管理有限公司指定账户，并在2020年7月30日16:00时前（遇节假日顺延）(携带付款凭证及相关身份材料)到九一融易资产管理有限公司签署《拍卖成交确认书》《房屋买卖居间合同》，同时依照银行要求提交按揭贷款手续，剩下的余款由该笔按揭银行贷款支付。<a name=\"_GoBack\"></a></span></p><p><span style=\"font-size:19px;font-family:宋体\">3</span><span style=\"font-size:19px;font-family: 宋体\">、拍卖成交后，买受人须在<span style=\"text-decoration:underline;\">2</span>日内按成交价的<span style=\"text-decoration:underline;\">2%</span>向九一融易资产</span></p><p><br/></p>",
